import './bookingpopup.css';

function Bookingpopup() {
    return(
        <>
        <div className="popup-box">
        <div className="popup">
<h2>Success Message</h2>
<h4>**Thank for Your Order.**</h4>
<button typy='button' className="btn">OK</button>

        </div>
        </div>
        </>
    )
};

export default Bookingpopup;
